export class EndPointConstants {
  public WebService = {
    newsEndPointById: (newId: any) =>
      `https://challenge.avantio.pro/v1/trends/${newId}`,
    newsEndPoint: () => 'https://challenge.avantio.pro/v1/trends',
  };
}
